import React from 'react';
import './Navbar.css';
import logo from '../assets/got7logo.png';
import { Routes, Route, NavLink } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <div className="pic"  style={{marginRight:'0'}}>
        <img className="logo7" src={logo} alt="Logo" />
        </div>
      </div>
      <div style={{justifyItems:'start'}}>
      <ul className="navbar-menu">
        <li className="navbar-item">
          <a href="/" className="navbar-link">HOME</a>
        </li>
        <li className="navbar-item">
          <a href="/discography" className="navbar-link">DISCOGRAPHY</a>
        </li>
        <li className="navbar-item">
          <a href="/notice" className="navbar-link">NOTICE</a>
        </li>
        <li className="navbar-item">
          <a href="/schedule" className="navbar-link">SCHEDULE</a>
        </li>
        <li className="navbar-item">
          <a href="/contact" className="navbar-link">CONTACT</a>
        </li>
        <li className="navbar-item">
          <a href="/about" className="navbar-link">ABOUT</a>
        </li>
      </ul>
      <nav className="mem_links" style={mem_links}>
              <NavLink
                className="nav"
                to={"/Member01"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "#3C8350",
                  fontWeight: "bold",
                }}
              >
                Jay B
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member02"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Mark
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member03"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Jackson
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member04"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Jinyoung
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member05"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Youngjae
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member06"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                BamBam
              </NavLink>
              <NavLink
                className="nav"
                to={"/Member07"}
                style={{
                  textDecoration: "none",
                  marginBottom: "5px",
                  color: "black",
                }}
              >
                Yugyeom
              </NavLink>
            </nav>
      </div>
    </nav>
  );
}

export default Navbar;
